import React from 'react'
import { Link } from "react-router-dom";

const Buy = () => {
  return (
    <div>
        <h2>Buy?</h2>
<button> <Link to = '/Buy'> Buy</Link> </button>
<button> <Link to = '/Sell'> Sell</Link> </button>
    </div>
  )
}

export default Buy
